import React from "react";
import PostDetail from "./PostDetail"

const Posts = ({posts}) => {
    console.log(posts._id, 'this is posts')
    return(
        <div>
            {posts.map((item)=>{
                return <PostDetail key={posts._id} post={item}/>
            })}
        </div>
    )
}

export default Posts
